import React, { Component } from 'react'

export default class SearchPanel extends Component {
    constructor(props){

        this.props = {
            searchText : 'Type here to search',
        }
    }

    render() {      
        return (
            <input type="search" placeholder={this.searchText}/>
        )
    }
}
